    <desc lang="en">TUNG KOON (AU YEUNG CHUN WAH, BOBBY) born with a special 'King's Tongue' is betrayed by his assistant, SIU SIU (CHAN MIU YING, MARIANE) who had prepared some chili source without permission. TUNG is accused of deceiving the Emperor and is forced to flee from Guangzhou to the capital. When SIU discovered that someone had used her to trap TUNG, she sees TUNG in person and apologizes. TUNG and SIU eventually reconcile. Love feeling blossoms between them. They join together to cook a very delicious 'Marinated Lung Slice'. The Emperor, KIN LUNG (KWONG WA) loves it very much and offer TUNG to work in the palace kitchen. Since then TUNG becomes one of the Emperor's favourite officials. TUNG's good friend, MIN LEUNG (KWOK CHUN ON) gains an official title with his wife, TSUI FA (LEUNG NGAI LING, FIONA)'s support. However, LEUNG abandons FA because of the reunion with his old lover, SIN YUNG (CHEONG WAI YEE, ANGIE). In order not to ruin LEUNG's reputation, FA tolerates. Unexpectedly, YUNG accepts bribes secretly on behalf of LEUNG. YUNG's act ruins LEUNG's future….</desc>
